import { Route, Routes, Link, Navlink } from 'react-router-dom';
import './App.scss';
import Deprem from './components/Deprem';
import DepremKayip from './components/DepremKayip';
import Toplanma from './components/Toplanma';
import Bilgi from './components/Bilgi';


function App() {

 
  return (
    <div className='mainContainer'>
    <nav>
      <ul>
      <li>
          <Link className='link' to='https://overdrivetr.com/'>Deprem Kayıp Sistemi</Link>
      </li>
      <li>
          <Link className='link' to='https://overdrivetr.com/deprem-raporlari'>Deprem Raporları</Link>
      </li>
      <li>
          <Link className='link' to='https://overdrivetr.com/toplanma-alanlari'>Toplanma Alanları</Link>
      </li>
      <li>
          <Link className='link' to='https://overdrivetr.com/gonullu-bilgiler'>Gönüllü Bilgiler</Link>
      </li>
      </ul>
    </nav>
    <Routes>
      <Route path="https://overdrivetr.com/" element={<DepremKayip/>}/>
      <Route path='https://overdrivetr.com/deprem-raporlari' element={<Deprem />} />
      <Route path='https://overdrivetr.com/toplanma-alanlari' element={<Toplanma />} />
      <Route path='https://overdrivetr.com/gonullu-bilgiler' element={<Bilgi/>}/>
    </Routes>
  </div>
  );
}

export default App;
